import React, { Component } from "react";
import StudentNavMenu from "./StudentNavMenu";
import { Accordion } from "react-bootstrap";
import StudentFormCard from "./StudentFormCard";
import PersonalInformation from "./StudentFormCard";

export default class Student extends Component {
  constructor(props) {
    super(props);
    this.toggleStudentFormCard = this.toggleStudentFormCard.bind(this);
  }

  toggleStudentFormCard() {}

  render() {
    return (
      <div className="student-container">
        <StudentNavMenu
          onClickHandler={this.toggleStudentFormCard}
        ></StudentNavMenu>
        <div className="student-form-container ml-auto">
          <Accordion defaultActiveKey="0" className="sfc-accordion">
            <PersonalInformation
              id="0"
              componentName="Personal Information"
            ></PersonalInformation>
          </Accordion>
        </div>
      </div>
    );
  }
}
